    false,nt"url": null,nt"notes": "This report outlines the basis of each
    goal and objective being considered in the bison and elk management planning process.
    USFWS guidelines on developing goals and objectives for national wildlife refuges
    calls for the basis of objectives to be documented as part of the planning process
    (USFWS 2003). Although the NPS does not have similar requirements, documenting the
    basis of goals and objectives is consistent with NPS policy that calls for each
    national park to be able to demonstrate how decisions relate to one another in terms
    of a logical, trackable rationale (NPS 2000:2.1.1 , 2.2). This report outlines the
    basis and rationale behind each of the goals and objectives being considered in
    the Bison and Elk Management Planning process.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
